{'response': "War's a joke for me and you,
A jest beneath the thundered skies;
We share a laugh when bullets flew,
And mask the fear behind our eyes.

The cannons echo in the night,
We giggle as the rockets glare;
The world gone mad—a child’s delight,
We dance with death as if it’s fair.

But jokes grow thin with breaking dawn,
When laughter’s veil is torn apart;
War’s no joke when hope is gone,
And sorrow’s laughter cracks the heart.", 'probability': 1.0}

{'response': "From childhood's hour I have not been
A dweller in the sunlit gleam;
My path has wound through shadowed green,
A half-remembered, restless dream.

The songs of others reached my ear,
Yet echoed not within my chest;
I learned to walk beside my fear,
A lonely wanderer, never guest.

Yet in the dusk, I learned to trace
The patterns only darkness weaves;
From childhood's hour, a hidden place—
The solace only twilight leaves.", 'probability': 1.0}

{'response': 'On the scene came Christ The Lord, not with peace but with a sword;
He cleaved the veils of certainty and every false accord.
No olive branch in tender hand, but fire forged anew—
He called the world to reckon with the things it thought it knew.

Not gentle words but questions sharp to pierce the stony heart,
To sunder bonds of empty creed and tear the lies apart.
His blade, the truth—unyielding, bright—divides the night from day;
And bids us rise, transformed by light, to walk a fiercer way.', 'probability': 1.0}

{'response': 'On the scene came Christ The Lord, not with peace but with a sword.
Beneath the olive trees’ embrace, a thunder broke the ancient chord.
